declare const SQL_QUERY = "\nUPDATE OR IGNORE Email SET\n  \"email\" = IFNULL(@email, \"email\"), \"createdAt\" = IFNULL(@createdAt, \"createdAt\"), \"updatedAt\" = IFNULL(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"deliverable\" = IFNULL(@deliverable, \"deliverable\"), \"personId\" = IFNULL(@personId, \"personId\")\nWHERE\n  \"personId\" = @personId AND \"email\" = @email\n";
export default SQL_QUERY;
